svg.script:
(function () {
  "use strict";

  function init(){
    var docs = document.getElementById('docs');

    var token2 = document.getElementById('token2');
    var token3 = document.getElementById('token3');
    var tl = new TimelineMax({repeat:-1});

    tl.set(docs, {x:320, y:3860, autoAlpha:0});
    tl.to(docs, .2, {x:405, y:3817, autoAlpha:1, ease:Power0.easeNone});
    tl.to(docs, .6, {x:590, y:3925, ease:Power0.easeNone});
    tl.to(docs, 1.2, {x:990, y:3680, ease:Power0.easeNone});
    tl.to(docs, .6, {x:790, y:3553, ease:Power0.easeNone});
    tl.to(docs, .4, {autoAlpha:0, ease:Power0.easeNone}, '-=.5');


    new TimelineMax({repeat:-1, repeatDelay:3, delay:.8}).set(token2, {x:440, y:70, autoAlpha:0}).to(token2, .2, {x:340, y:20, autoAlpha:1, ease:Power0.easeNone})
        .to(token2, .4, {x:-80, y:275, ease:Power0.easeNone}).to(token2, .2, {x:60, y:330, ease:Power0.easeNone}).to(token2, .2, {x:140, y:390, ease:Power0.easeNone}).to(token2, .2, {x:50, y:430, autoAlpha:0, ease:Power0.easeNone});
    new TimelineMax({repeat:-1, repeatDelay:3, delay:1.6}).set(token3, {x:440, y:70, autoAlpha:0}).to(token3, .2, {x:340, y:20, autoAlpha:1, ease:Power0.easeNone})
        .to(token3, .4, {x:-80, y:275, ease:Power0.easeNone}).to(token3, .2, {x:60, y:330, ease:Power0.easeNone}).to(token3, .2, {x:140, y:390, ease:Power0.easeNone}).to(token3, .2, {x:50, y:430, autoAlpha:0, ease:Power0.easeNone});

    tl.to({}, 1.6, {});
  }

  window.addEventListener('load', init);
}());
